    return ( 
        <tr>
            <th scope="row">1</th>
            <td>Brandon Jacob</td>
            <td>Tính từ</td>
            <td>28</td>
            <td>
                <button >
                    <i className="ti ti-eye" />
                </button>
            </td>
        </tr>
    );
}

